def solve_sudoku(board):
    # Helper function to find the next empty cell
    def find_empty():
        for i in range(9):
            for j in range(9):
                if board[i][j] == '.':
                    return (i, j)
        return None

    # Helper function to get possible numbers for a cell
    def possible_numbers(r, c):
        used = set()
        # Check row
        for num in board[r]:
            if num != '.' and num != r:
                used.add(num)
        # Check column
        for i in range(9):
            num = board[i][c]
            if num != '.' and num != c:
                used.add(num)
        # Check subgrid
        subgrid_r = (r // 3) * 3
        subgrid_c = (c // 3) * 3
        for i in range(subgrid_r, subgrid_r + 3):
            for j in range(subgrid_c, subgrid_c + 3):
                num = board[i][j]
                if num != '.' and num != r and num != c:
                    used.add(num)
        # Collect possible numbers
        possible = []
        for num in range(1, 10):
            if num not in used:
                possible.append(num)
        return possible

    # Constraint propagation loop
    while True:
        empty = find_empty()
        if empty is None:
            break
        row, col = empty
        possible = possible_numbers(row, col)
        if len(possible) == 1:
            board[row][col] = possible[0]

    # Backtracking function
    def solve(board):
        empty = find_empty()
        if empty is None:
            return True  # Board solved
        row, col = empty
        for num in possible_numbers(row, col):
            board[row][col] = num
            if solve(board):
                return True
            board[row][col] = '.'  # backtrack
        return False  # Trigger backtracking

    # Perform backtracking
    solve(board)
    return board
